import React from 'react';
import { motion } from 'framer-motion';
import NavBar from './Menu/Nav'

const App = () => {
  return (
    <div className="App">
      <motion.h1
        initial={{ opacity: 0}}
        animate={{ opacity: 1}}
        transition={{ duration: 2, ease: "easeOut" }}
        className="text-5xl font-bold text-blue-600 shadow-lg text-left"
      >
        <NavBar />
      </motion.h1>
    </div>


  );
};

export default App;
